using namespace std;

class Plant {
public:
    Plant() : quantity(0) {}

    bool is_status(const string_view status) const {
        return this->status == status;
    }

    bool is_least(const Plant& plant) const {
        return quantity < plant.quantity;;
    }

    bool is_family(const string_view family) const {
        return this->family == family;
    }

    const string& get_genus() const {
        return genus;
    }
private:
    string genus;
    string family;
    string order;
    string status;
    int quantity;

    friend ostream& operator<<(ostream& out, const Plant& plant) {
        return out << "–ü–æ—Ä—è–¥–æ–∫: " << plant.order << '\n'
            << "–°–µ–º–µ–π—Å—Ç–≤–æ: " << plant.family << '\n'
            << "–†–æ–¥: " << plant.genus << '\n'
            << "–í–∏–¥–æ–≤–æ–µ —Ä–∞–∑–Ω–æ–æ–±—Ä–∞–∑–∏–µ: " << plant.quantity << '\n'
            << "–û—Ö—Ä–∞–Ω–Ω—ã–π —Å—Ç–∞—Ç—É—Å: " << plant.status << '\n';
    }

    friend istream& operator>>(istream& inp, Plant& plant) {
        cout << "–ü–æ—Ä—è–¥–æ–∫: ";
        getline(inp, plant.order);
        cout << "–°–µ–º–µ–π—Å—Ç–≤–æ: ";
        getline(inp, plant.family);
        cout << "–†–æ–¥: ";
        getline(inp, plant.genus);
        cout << "–í–∏–¥–æ–≤–æ–µ —Ä–∞–∑–Ω–æ–æ–±—Ä–∞–∑–∏–µ: ";
        inp >> plant.quantity;
        inp.ignore(0x1000, '\n');
        cout << "–û—Ö—Ä–∞–Ω–Ω—ã–π —Å—Ç–∞—Ç—É—Å: ";
        getline(inp, plant.status);
        cout.put('\n');
        return inp;
    }
};

using plants_t = array<Plant, 10>;

void status_show(const plants_t& plants, const string_view status) {
    for (const auto& plant : plants) {
        if (plant.is_status(status)) {
            cout << plant << '\n';
        }
    }
}

void genus_least(const plants_t& plants) {
    Plant plant = plants.front();
    for (size_t i = 1; i < plants.size(); ++i) {
        if (plants[i].is_least(plant)) {
            plant = plants[i];
        }
    }
    cout << "–†–æ–¥ —Ä–∞—Å—Ç–µ–Ω–∏–π —Å –Ω–∞–∏–º–µ–Ω—å—à–∏–º –≤–∏–¥–æ–≤—ã–º —Ä–∞–∑–Ω–æ–æ–±—Ä–∞–∑–∏–µ–º: "
         << plant.get_genus() << "\n\n";
}

void show_list_genus_from_family(const plants_t& plants, const string_view family) {
    set<string> genera;
    for (const auto& plant : plants) {
        if (plant.is_family(family)) {
            genera.insert(plant.get_genus());
        }
    }
    auto n = 0;
    for (const auto& genus : genera) {
        cout << ++n << ". " << genus << '\n';
    }
    cout.put('\n');
}

int choice() {
    puts("–í—ã–±–∏—Ä–∏—Ç–µ –¥–µ–π—Å—Ç–≤–∏–µ...");
    puts("0. –í—ã—Ö–æ–¥ –∏–∑ –ø—Ä–æ–≥—Ä–∞–º–º—ã");
    puts("1. –í—ã–≤–µ—Å—Ç–∏ —Å–ø–∏—Å–æ–∫ —Ä–∞—Å—Ç–µ–Ω–∏–π –∑–∞–¥–∞–Ω–Ω–æ–≥–æ –æ—Ö—Ä–∞–Ω–Ω–æ–≥–æ —Å—Ç–∞—Ç—É—Å–∞");
    puts("2. –í—ã–≤–µ—Å—Ç–∏ —Ä–æ–¥ —Ä–∞—Å—Ç–µ–Ω–∏–π —Å –Ω–∞–∏–º–µ–Ω—å—à–∏–º –≤–∏–¥–æ–≤—ã–º —Ä–∞–∑–Ω–æ–æ–±—Ä–∞–∑–∏–µ–º");
    puts("3. –í—ã–≤–µ—Å—Ç–∏ —Å–ø–∏—Å–æ–∫ —Ä–æ–¥–æ–≤ —Ä–∞—Å—Ç–µ–Ω–∏–π –∑–∞–¥–∞–Ω–Ω–æ–≥–æ —Å–µ–º–µ–π—Å—Ç–≤–∞");
    cout << ">>> ";
    int value;
    cin >> value;
    cin.ignore(0x1000, '\n');
    cout.put('\n');
    return value;
}

string query(const char* prompt) {
    string value{ "\n" };
    while (value.front() == '\n') {
        cout << prompt;
        getline(cin, value);
    }
    cout.put('\n');
    return value;
}

const auto load() {
    plants_t plants{};
    puts("–í–≤–µ–¥–∏—Ç–µ –¥–∞–Ω–Ω—ã–µ...\n");
    for (auto& plant : plants) {
        cin >> plant;
    }
    return plants;
}

int main() {
    system("chcp 1251 > nul");
    const auto plants = load();
    auto run = true;
    while (run) {
        switch (choice()) {
            case 0:
                run = false;
                break;
            case 1:
                status_show(plants, query("–í–≤–µ–¥–∏—Ç–µ –æ—Ö—Ä–∞–Ω–Ω—ã–π —Å—Ç–∞—Ç—É—Å: "));
                break;
            case 2:
                genus_least(plants);
                break;
            case 3:
                show_list_genus_from_family(plants, query("–í–≤–µ–¥–∏—Ç–µ —Å–µ–º–µ–π—Å—Ç–≤–æ: "));
                break;
            default:
                puts("–û—à–∏–±–∫–∞ –ø—Ä–∏ –≤—ã–±–æ—Ä–µ\n");
        }
    }
}

