            for(int k = 1; k <= n; k++){
                if(con == 0){
                    break;
                }
                else if(arr[i][j] == k * k){
                    con--;
                }
            }
            printf("%d ", arr[i][j]);
        }
        printf("\n");
    }
    if(con == 0){
        printf("All numbers from 1 to n^2 are in the array");
    }
    else{
        printf("Condition Failed");
    }
    return 0;
}
